import React from "react";

class Add extends React.Component{
    constructor(){
        super()
        this.state = {
            number : "helo",
        }
    }

    increase () {
        this.setState({number : "Hello Brother"})
    }



    render(){
        return(
            <div>
                <h1>QUANTITY : {this.state.number}</h1>
                <button onClick={this.increase}>+</button>
                <button>-</button>
            </div>
        )
    }
}

export default Add
